import React from 'react';
import { View, StyleSheet } from 'react-native';
import DashboardCard from '../../../';  // adjust the path

const LandlordDashboard = () => {
    // These values can come from your app's state or API calls.
    const totalProperties = 5;
    const totalTenants = 10;
    const totalPayments = 3;

    return (
        <View style={styles.container}>
            <DashboardCard 
                totalProperties={totalProperties}
                totalTenants={totalTenants}
                totalPayments={totalPayments}
            />
            {/* You can add more components below this */}
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        padding: 20,
        backgroundColor: '#f8f8f8',
    },
});

export default LandlordDashboard;
